import React, { Component } from 'react';
import StatsCard from './StatsCard';
import {Row, Col, Dropdown } from "react-bootstrap";
import AdminNavbar from "./AdminNavbar";
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const mealUrl = "https://api.fitbit.com/1/user/28H22H/foods/log/date/2015-09-01.json"


export default class Home extends Component 
{
  constructor(props)
  {
    super(props)
    this.setState = {
      endDate :  new Date(),
      mealLog : {}
    }
  }

componentDidMount()
{

}

    render() {
        return (
          <div className="main-panel" id="main-panel">
          <AdminNavbar data={this.props.userDetails}/>
            <div className="content">
        <div className="container">
          <Row>
            <Col><Dropdown>
  <Dropdown.Toggle variant="success" id="dropdown-basic">
    Select Food Filters
  </Dropdown.Toggle>
  <Dropdown.Menu>
    <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
    <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown></Col>
            <Col><DatePicker selected={this.state.startDate} onChange={(date) => this.setState({ startDate: date })}name="startDate"
              dateFormat="MM/dd/yyyy"/></Col>

          </Row>
          <Row>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-server text-warning" />}
                statsText="Capacity"
                statsValue="500"
                statsIcon={<i className="fa fa-refresh" />}
                statsIconText="Updated now"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-wallet text-success" />}
                statsText="Revenue"
                statsValue="$1,345"
                statsIcon={<i className="fa fa-calendar-o" />}
                statsIconText="Last day"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-graph1 text-danger" />}
                statsText="Errors"
                statsValue="23"
                statsIcon={<i className="fa fa-clock-o" />}
                statsIconText="In the last hour"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="fa fa-twitter text-info" />}
                statsText="Followers"
                statsValue="+45"
                statsIcon={<i className="fa fa-refresh" />}
                statsIconText="Updated now"
              />
            </Col>
          </Row>
          </div>
      </div>
      </div>

        )
    }
}
